window.bookSummaryJSON = "<p><b>We met. We kissed. We fought for our happily-ever-after, but true love stories never end.</b></p> <p>I promised her protection. I promised to keep her safe. I thought I could, until an attack reminds me that our lives will never be simple. But while I try to shield her, Clara refuses to be intimidated by me or anyone else. </p> <p>She thinks hosting the Sovereign Games will bring us all together - as a nation and a family - but someone is working against us. Someone who wants to see my secrets exposed to the world...and to her.</p> <p>Because, the only thing my family has ever buried is its secrets, and when she discovers the truth, I might lose everything.</p> <p>Scandal, betrayal, romance - welcome to the Royal World.</p> <p>Geneva Lee, <i>The New York Times</i> best-selling author of the Royals Saga returns with <i>Cross Me</i>, a new tale of seduction, secrets, and the worldâ€™s most watched family.</p>"; 
